import React from 'react';
import { Navbar, Nav, Container } from 'react-bootstrap';
import { Link, useNavigate } from 'react-router-dom';

const CustomNavbar = ({ role, logout }) => {
  const navigate = useNavigate();

  const handleLogout = () => {
    logout();
    navigate('/login');
  };

  return (
    <Navbar bg="primary" variant="dark" expand="lg">
      <Container>
        <Navbar.Brand as={Link} to="/">LUCT Reporting System</Navbar.Brand>
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav">
          <Nav className="me-auto">
            {/* Links for unauthenticated users */}
            {!role && (
              <>
                <Nav.Link as={Link} to="/login">Login</Nav.Link>
                <Nav.Link as={Link} to="/register">Register</Nav.Link>
              </>
            )}

            {/* Links for student */}
            {role === 'student' && (
              <>
                <Nav.Link as={Link} to="/monitoring">Monitoring</Nav.Link>
                <Nav.Link as={Link} to="/rating">Rating</Nav.Link>
              </>
            )}

            {/* Links for lecturer */}
            {role === 'lecturer' && (
              <>
                <Nav.Link as={Link} to="/classes">Classes</Nav.Link>
                <Nav.Link as={Link} to="/reports">Reports</Nav.Link>
                <Nav.Link as={Link} to="/monitoring">Monitoring</Nav.Link>
                <Nav.Link as={Link} to="/rating">Rating</Nav.Link>
              </>
            )}

            {/* Links for prl */}
            {role === 'prl' && (
              <>
                <Nav.Link as={Link} to="/courses">Courses</Nav.Link>
                <Nav.Link as={Link} to="/reports">Reports</Nav.Link>
                <Nav.Link as={Link} to="/monitoring">Monitoring</Nav.Link>
                <Nav.Link as={Link} to="/rating">Rating</Nav.Link>
                <Nav.Link as={Link} to="/classes">Classes</Nav.Link>
              </>
            )}

            {/* Links for pl */}
            {role === 'pl' && (
              <>
                <Nav.Link as={Link} to="/courses">Courses</Nav.Link>
                <Nav.Link as={Link} to="/reports">Reports</Nav.Link>
                <Nav.Link as={Link} to="/monitoring">Monitoring</Nav.Link>
                <Nav.Link as={Link} to="/classes">Classes</Nav.Link>
                <Nav.Link as={Link} to="/lectures">Lectures</Nav.Link>
                <Nav.Link as={Link} to="/rating">Rating</Nav.Link>
              </>
            )}
          </Nav>

          <Nav>
            {/* Only show Logout if user is logged in */}
            {role && <Nav.Link onClick={handleLogout}>Logout</Nav.Link>}
          </Nav>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
};

export default CustomNavbar;
